# Object type for items with width and height
Item = DSRecord({
    "width": DSInt(lb=1, ub=100),
    "height": DSInt(lb=1, ub=100)
})

# Object type for position (x, y) coordinates
Position = DSRecord({
    "x": DSInt(lb=0, ub=100),
    "y": DSInt(lb=0, ub=100)
})



# --- Constants and Decision Variables ---
BOX_HEIGHT : DSInt(lb=1, ub=100) = 100
BOX_WIDTH : DSInt(lb=1, ub=100) = 100
ITEM1 : Item = {"width": 30, "height": 15}
ITEM2 : Item = {"width": 13, "height": 3}
ITEM3 : Item = {"width": 7, "height": 27}
ITEM4 : Item = {"width": 29, "height": 12}
ITEM5 : Item = {"width": 7, "height": 2}
ITEM6 : Item = {"width": 19, "height": 14}
ITEM7 : Item = {"width": 13, "height": 12}
ITEM8 : Item = {"width": 21, "height": 2}
ITEM9 : Item = {"width": 16, "height": 4}
ITEM10 : Item = {"width": 17, "height": 14}
ITEM11 : Item = {"width": 19, "height": 4}
ITEM12 : Item = {"width": 32, "height": 30}
ITEM13 : Item = {"width": 5, "height": 17}
ITEM14 : Item = {"width": 2, "height": 8}
ITEM15 : Item = {"width": 33, "height": 23}
ITEM16 : Item = {"width": 12, "height": 23}
ITEM17 : Item = {"width": 5, "height": 15}
ITEM18 : Item = {"width": 19, "height": 19}
ITEM19 : Item = {"width": 4, "height": 31}
ITEM20 : Item = {"width": 27, "height": 23}
ITEMS : DSList(length=20, elem_type=Item) = [ITEM1, ITEM2, ITEM3, ITEM4, ITEM5, ITEM6, ITEM7, ITEM8, ITEM9, ITEM10, ITEM11, ITEM12, ITEM13, ITEM14, ITEM15, ITEM16, ITEM17, ITEM18, ITEM19, ITEM20]
N_ITEMS : int = 20
nr_used_boxes : DSInt(lb=0, ub=20)
item_box_assignments : DSList(length=20, elem_type=DSInt())
x_y_positions : DSList(length=20, elem_type=Position)
N_ITEMS : int = 20
N_ITEM_BOX_ASSIGNMENTS : int = 20
N_X_Y_POSITIONS : int = 20


# --- objective ---
def pack_items_in_boxes(items: DSList(length=20, elem_type=Item),
                        item_box_assignments: DSList(length=20, elem_type=DSInt()),
                        x_y_positions: DSList(length=20, elem_type=Position),
                        nr_used_boxes: int):
    # Constraint: Each item must be assigned to exactly one box (1 to nr_used_boxes)
    for i in range(1, N_ITEMS + 1):
        assert 1 <= item_box_assignments[i] <= nr_used_boxes

    # Constraint: Box dimensions must be respected
    for i in range(1, N_ITEMS + 1):
        assert x_y_positions[i].x + items[i].width <= BOX_WIDTH
        assert x_y_positions[i].y + items[i].height <= BOX_HEIGHT

    # Constraint: No overlapping items in same box
    for i in range(1, N_ITEMS + 1):
        for j in range(i+1, N_ITEMS + 1):
            assert item_box_assignments[i] != item_box_assignments[j] or not (
                (x_y_positions[i].x < x_y_positions[j].x + items[j].width) and 
                (x_y_positions[j].x < x_y_positions[i].x + items[i].width) and
                (x_y_positions[i].y < x_y_positions[j].y + items[j].height) and 
                (x_y_positions[j].y < x_y_positions[i].y + items[i].height)
            )

pack_items_in_boxes(ITEMS, item_box_assignments, x_y_positions, nr_used_boxes)
objective = nr_used_boxes
maximize(objective)

