def ensure_item_box_assignment_validity(items: DSList(length=20, elem_type=Item),
                                        item_box_assignments: DSList(length=20, elem_type=DSInt()),
                                        x_y_positions: DSList(length=20, elem_type=Position),
                                        nr_used_boxes: int):
    # Constraint: Each item must be placed in a box numbered between 1 and nr_used_boxes
    for i in range(1, N_ITEMS + 1):
        assert 1 <= item_box_assignments[i] <= nr_used_boxes

    # Constraint: Item placement respects box boundaries
    for i in range(1, N_ITEMS + 1):
        assert x_y_positions[i].x + items[i].width <= BOX_WIDTH
        assert x_y_positions[i].y + items[i].height <= BOX_HEIGHT

    # Constraint: Items in the same box must not overlap
    for i in range(1, N_ITEMS + 1):
